import React, { useEffect } from 'react';
import Header from './Header';
import Navbar from './Navbar';
import Catalog from './Catalog';
import { createClient } from '@supabase/supabase-js';
import { useNavigate } from 'react-router-dom';

const supabase = createClient(
    "https://fkkbobhpegfhfsvbhcid.supabase.co",
    "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmhwZWdmaGZzdmJoY2lkIiwicm9sZSI6ImFub24iLCJpYXQiOjE3MTgzNjAzOTAsImV4cCI6MjAzMzkzNjM5MH0.0g1YrLe4lF9HJUKHEuh5_toW_5f_k2C2g7dEMrpU3dQ"
);

export default function App({ user, setUser, csvData, setCsvData }) {
    const navigate = useNavigate();

    useEffect(() => {
        async function getUserData() {
            const { data } = await supabase.auth.getUser();
            if (data.user) {
                setUser(data.user);
            }
        }
        getUserData();
    }, [setUser]);

    return (
        <div className="App">
            {
                user && user.id ?
                    <>
                        <Navbar />
                        <Catalog userId={user.id} csvData={csvData} setCsvData={setCsvData} />
                    </>
                    :
                    <>
                        <h1> User is Not Logged In</h1>
                        <button onClick={() => { navigate("/") }} >Go to Home Page</button>
                    </>
            }
        </div>
    );
}


